import React from 'react';
import Sidebar from '../../components/Sidebar';
import './Dashboard.css';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="dashboard-main">
        {/* 这里是主内容区 */}
      </div>
    </div>
  );
};

export default Dashboard;
